    >
      <div className="mx-auto max-w-[800px] text-center">
        <div className="text-7xl">
          <h1>امپــراتـــوری</h1>
          <h1 className="text-red-600">کـــــــــــــــــــد</h1>
        </div>
      </div>
    </section>
  );
};

export default Hero;
